import React from 'react';
import { ListGroupItem } from 'reactstrap';
import {Link} from 'react-router-dom'
import './CityBox.css'

class CityBox extends React.Component {
    constructor(props) { 
        super(props);
        this.state = {
            city: []
        };
    }

    render() {  
        return(
            <div className="CityBox"  >
                <Link to = {{ pathname: "/cities/" + this.props.city._id }}> 
                    <ListGroupItem className="CityBoxList" style={{ backgroundImage: `url(${process.env.PUBLIC_URL + this.props.city.image}` }}>
                        <h5>{this.props.city.name}</h5> {console.log('http://localhost:5000/' + this.props.city.image)}
                    </ListGroupItem> 
                </Link>
            </div>
        )
    }
}

export default CityBox;
